social_posts.post_text:
@tickperformance billet short shifter for @tremecperformance MAGNUM XL.
We will fabricate a custom threaded base insert to allow the use of the existing ( discontinued) TWM shift knob and extender shift knob as was on the cd009.
This reduces throw and sits lower than the existing Tremec shifter.

Hell

Yes.

@lojconversions  provided the steel drive shaft for this swap/ trans combo.. And it fits perfectly as it is. Seems to be a common result using Steven's swap kit components.. Headers fit great as well. 😎👌

SWIPE.///
Electric power steering system is finally done.
@chasebays ps reservoir welded to a custom aluminum fluid tank on a TRW (Porsche/Volvo/Ford) electric pump.. @flfracingsupply AN fittings and lines..
@mishimoto mmoc10 cooler core..

The special canbus (original vehicle speed mimic) controller has a knob under the dash to dial in the right amount of assist pressure at any time, from 0-100% of the pumps duty cycle.. regardless if the engine is running..or even in the car at all lol. 
(No more default/ limp mode 70%/900psi)

It has begun!

@p_smoov_  with the labor favor, swapping over the glass and wiring and re-installing a set of @crown_carbon_crafting  doors on the z.
❤️👌😉🤝

This weekend was nothing short of exceptional. I cannot wait to go back and explore more with my favorite travel partner 🖤

#payson #paysonaz #campfire #campfood #explorin 
@bmccann101

Would ya just look at that..
I actually have a full exhaust now. 😁
3" tig stainless round,with V bands right off the cerakoted 1 7/8" headers, into a Y collector junction to the existing 4" oval @vibrant_performance stainless  single exhaust.. ending in a Magnaflow 4" deisel truck muffler.
(needs some dark cerakote paint as well.. It will not stay polished)

Can't wait to hear what this set up sounds like with the BTR stg2 CAMMED, overdriven and cnc ported LT4.
I expect a sweet chop, massive volume, and a deeper tone than usual... One that will punch everyone inc myself straight in the #sshole. 😂😎🤜👌

